from keras.datasets import mnist
import numpy as np
import matplotlib.pyplot as plt

#calculate the pixel intensity in the center of an image
def average_pixel_value(valid_image):
  pixel_array = np.array(valid_image[13:16, 13:16])
  average = np.average(pixel_array)
  return average

#count number of ones above or equal to a threshold
#and the number of zeros below the threshold
def correct_classifications(zeros_data, ones_data, threshold):
  count = 0
  for x in ones_data:
    if x >= threshold:
      count += 1
  for x in zeros_data:
    if x < threshold:
      count += 1
  return count

#load dataset and select only zeros and ones
(x_train, y_train), (x_test, y_test) = mnist.load_data()
x_train = x_train[(y_train == 0) | (y_train == 1), :, :]
y_train = y_train[(y_train == 0) | (y_train == 1)] 
x_test = x_test[(y_test == 0) | (y_test == 1), :, :]
y_test = y_test[(y_test == 0) | (y_test == 1)] 

#shuffle training set
num_train_img = x_train.shape[0]
train_ind = np.arange(0, num_train_img)
train_ind_shuffle = np.random.permutation(train_ind)
x_train = x_train[train_ind_shuffle, :, :]
y_train = y_train[train_ind_shuffle]

#select first 500 to be validation set
x_valid = x_train[0:500, :, :]
y_valid = y_train[0:500]

#the rest is the training data
x_train = x_train[500:, :, :]
y_train = y_train[500:]

zeros_indices = []
ones_indices = []
zeros_valid = []
ones_valid = []

#print("Red Triangles are for zeros\nGreen Squares are for ones")
for i in range(x_valid.shape[0]):
  data_point = average_pixel_value(x_valid[i, :, :])
  if y_valid[i] == 1:
    ones_indices.append(i)
    ones_valid.append(data_point)
  else:
    zeros_indices.append(i)
    zeros_valid.append(data_point)
plt.plot(ones_indices, ones_valid, "sg", label="1") #green squares for 1
plt.plot(zeros_indices, zeros_valid, "^r", label="0") #red triangles for 0
plt.title("Pixel Intensity Distribution")
plt.ylabel("Center Pixel Intensity")
plt.xlabel("Index in Dataset")
plt.legend(loc="upper right")
plt.show()

#find center pixel intensities for the training and testing set
zeros_train = []
ones_train = []
zeros_test = []
ones_test = []
#print("Number of images in training set: {}".format(x_train.shape[0]))
#print("Number of images in validation set: {}".format(x_valid.shape[0]))
#print("Number of images in testing set: {}".format(x_test.shape[0]))
for i in range(x_train.shape[0]):
  data_point = average_pixel_value(x_train[i, :, :])
  if y_train[i] == 1:
    ones_train.append(data_point)
  else:
    zeros_train.append(data_point)
for i in range(x_test.shape[0]):
  data_point = average_pixel_value(x_test[i, :, :])
  if y_test[i] == 1:
    ones_test.append(data_point)
  else:
    zeros_test.append(data_point)
#compute accuracy for threshold and print for all data sets
threshold = 150
print("When the threshold is {}, here are the accuracies: ".format(threshold))
print("Accuracy of training set: {:.2f}%".format(100 * correct_classifications(zeros_train, ones_train, threshold)/x_train.shape[0]))
print("Accuracy of validation set: {:.2f}%".format(100 * correct_classifications(zeros_valid, ones_valid, threshold)/x_valid.shape[0]))
print("Accuracy of testing set: {:.2f}%".format(100 * correct_classifications(zeros_test, ones_test, threshold)/x_test.shape[0]))

